import { withStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';

export const LoginGridItem = withStyles((theme) => ({
    root: {
      
        marginRight: '50px',
        marginTop: '20px',
        zIndex: 1,
    }
}))(Grid);
